import React, { Component } from "react";
import Layout from "../../components/Layout";
import {
    BrowserView,
    MobileView,
    isBrowser,
    isMobile
  } from "react-device-detect";
class Theresume extends Component {

    render() {
        return (
            <Layout title = "The Resume Game | AOWSAY">                
                <BrowserView>
                <div className="container text-center">
                    <h1>The Resume Game</h1>
                    <div className="row d-flex justify-content-center">                        
                        <div className="shadow-lg p-3 mb-5 bg-dark rounded">
                            <iframe frameborder="0" src="https://itch.io/embed-upload/1857824?color=333333" allowfullscreen="" width="940" height="510">
                                <a href="https://msomsap.itch.io/the-resume-game">Play The  Resume Game on itch.io</a>
                            </iframe>
                        </div>
                    </div>
                    <br />
                </div> 
                </BrowserView>
                <MobileView>
                <iframe src="https://itch.io/embed-upload/1857824?color=333333" style="position:fixed; top:0; left:0; bottom:0; right:0; width:100%; height:100%; border:none; margin:0; padding:0; overflow:hidden; z-index:999999;">
                </iframe>
                </MobileView>              
            </Layout>
        )
    }
}

export default Theresume;
